<h1>MMFI: Move Object to Back</h1>
<p><b>Description:</b></p>
<div style="margin-left: 1em;"><tt>void</tt> <b>mmf.Object.MoveToBack</b> ( number <tt>objectId</tt> )
<p>Changes an object's order to be below all others on the same layer.</p>
</div>
<p><b>Parameters:</b></p>
<div style="margin-left: 1em;">
<i>objectId</i>
<div style="margin-left: 1em;">ID of exported object</div>
</div>
<p><b>Return Values:</b></p>
<div style="margin-left: 1em;">None</div>
